{Cot[c + d*x]^3*(a + b*Tan[c + d*x])^2*(B*Tan[c + d*x] + C*Tan[c + d*x]^2), x, 5, -((a^2*B - b^2*B - 2*a*b*C)*x) - (a^2*B*Cot[c + d*x])/d - (b^2*C*Log[Cos[c + d*x]])/d + (a*(2*b*B + a*C)*Log[Sin[c + d*x]])/d}
