{Tan[c + d*x]^0*(a + b*Tan[c + d*x])^3*(B*Tan[c + d*x] + C*Tan[c + d*x]^2), x, 5, -((3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*x) - ((a^3*B - 3*a*b^2*B - 3*a^2*b*C + b^3*C)*Log[Cos[c + d*x]])/d + (b*(a^2*B - b^2*B - 2*a*b*C)*Tan[c + d*x])/d + ((a*B - b*C)*(a + b*Tan[c + d*x])^2)/(2*d) + (B*(a + b*Tan[c + d*x])^3)/(3*d) + (C*(a + b*Tan[c + d*x])^4)/(4*b*d)}
