{Cot[c + d*x]^6*(a + b*Tan[c + d*x])^3*(B*Tan[c + d*x] + C*Tan[c + d*x]^2), x, 7, (3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*x + ((3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*Cot[c + d*x])/d + (a*(2*a^2*B - 5*b^2*B - 6*a*b*C)*Cot[c + d*x]^2)/(4*d) - (a^2*(3*b*B + 2*a*C)*Cot[c + d*x]^3)/(6*d) + ((a^3*B - 3*a*b^2*B - 3*a^2*b*C + b^3*C)*Log[Sin[c + d*x]])/d - (a*B*Cot[c + d*x]^4*(a + b*Tan[c + d*x])^2)/(4*d)}
